import { Paper, Typography, makeStyles, IconButton } from "@material-ui/core";
import CheckBox from "@material-ui/core/Checkbox";
import React from 'react'
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';
const useStyle = makeStyles({
    root:{
        width:'100%',
        margin:'5px 0',
        display:'flex',
        justifyContent:'start',
        alignItems:'center',
        cursor:'pointer',
        background:'rgba(202, 211, 200,1.0)',
        transition:'.3s ease',
        opacity:0.5,
        
        '&:hover':{
            transform:'translateY(-4%)',
        }
    }
})


export default function ListComplete({asset, active, delCompleted}){
    const classes = useStyle();
    const [checked,setChecked] = React.useState(false)

    //-------function-----------//
    
    return(
        <Paper spacing={2} className={classes.root} >
            <CheckBox
                checked={asset.isCompleted}
                disabled
                onClick={()=> active(asset.id, asset.todo, asset.isCompleted)}
            />
            <Typography style={{width:'80%'}} align='left'  children={asset.todo} />
            <IconButton onClick={()=>delCompleted(asset.id)} >
                <DeleteOutlineIcon />
            </IconButton>
        </Paper>
    )
}
